  input: '"TEXT","F3XA","C00143743","Transfers shown on Schedule H4 to the non-federal
    account were made for refunds/reimbursements received by the Committee and shown
    on Schedule A Line 15. The refunds/reimbursements were made by former and current
    employees of the Committee for COBRA health insurance payments by the Committee
    to Humana and by the Texas Federation of Republican Women for sub-lease rent and
    postage. The payments to the vendors (900 Congress and Pitney Bowes) are reported
    within this report. Reimbursements were made either prior to the expenditure or
    within a commercially reasonable time.  In response to the Commission''s February
    25, 2004 letter, the Committee amends its report as follows.  Items on Schedule
    B that the Commission questions were for Fundraising activities for the Committee,
    not express advocacy for any federal candidate. Transfers from the non-federal
    account in July 2003 included amounts for the non-federal share of allocable expenditures
    made in 2003, but within the seventy day window permitted by the regulations cited
    in the Commission''s letter. Since no prohibited transfers occurred and no excessive
    transfers occurred, no further action by the Committee is required. No staff members
    spent 25% or more of their time on activities in connection with a federal election
    during the month of July 2003, and thus these salaries were not required to be
    reported on Line 30b.  The Committee notes that salaries paid with federal funds
    do appear on Schedule B Line 21b."'
